      navigate("/signin");
    } else {
      console.log("Ê£ÄÊµãÂà∞Áî®Êà∑ÔºåÂÖÅËÆ∏ËÆøÈóÆÈ°µÈù¢");
      // Ê∏ÖÈô§ÂèØËÉΩÂ≠òÂú®ÁöÑÈîôËØØ‰ø°ÊÅØ
      setError("");
    }
  }, [user, navigate]);

  const handleTypeSelect = async (type) => {
    try {
      setIsLoading(true);
      setError("");
      setSelectedType(type);

      const token = localStorage.getItem("token");
      if (!token) {
        throw new Error("Êú™ÁôªÂΩïÔºåËØ∑ÂÖàÁôªÂΩï");
      }

      // Ë∞ÉÁî®API‰øùÂ≠òÁªÑÁªáÁ±ªÂûã
      const response = await fetch("http://localhost:3001/api/profile/type", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify({ orgType: type }),
      });

      const data = await response.json();

      if (!response.ok) {
        // Â§ÑÁêÜÁâπÂÆöÁöÑÈîôËØØÊ∂àÊÅØ
        if (data.message === "Invalid organization type") {
          throw new Error("Êó†ÊïàÁöÑÁªÑÁªáÁ±ªÂûãÔºåËØ∑ÈÄâÊã©ÊúâÊïàÁöÑÁªÑÁªáÁ±ªÂûã");
        } else {
          throw new Error(data.message || "‰øùÂ≠òÁªÑÁªáÁ±ªÂûãÂ§±Ë¥•");
        }
      }

      if (data.code === 0) {
        // ‰øùÂ≠òÊàêÂäüÂêéÔºåÂ∞ÜÁ±ªÂûãÂ≠òÂÇ®Âú®localStorage‰∏≠‰æõÂÖ∂‰ªñÈ°µÈù¢‰ΩøÁî®
        localStorage.setItem("orgType", type);
        // ÂØºËà™Âà∞ËØ¶ÁªÜ‰ø°ÊÅØÈ°µÈù¢
        navigate("/profile-setup/details");
      } else {
        throw new Error(data.message || "Êú™Áü•ÈîôËØØ");
      }
    } catch (error) {
      console.error("‰øùÂ≠òÁªÑÁªáÁ±ªÂûãÈîôËØØ:", error);
      setError(error.message || "‰øùÂ≠òÁªÑÁªáÁ±ªÂûãÊó∂Âá∫Èîô");
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center px-4 sm:px-6 lg:px-8">
      <div className="max-w-md w-full space-y-8">
        <div>
          <h2 className="mt-6 text-center text-3xl font-bold text-gray-900">
            Tell us about your organization
          </h2>
          <p className="mt-2 text-center text-sm text-gray-600">
            Select your organization type to help us provide better partnership
            matches
          </p>
          {error && (
            <p className="mt-2 text-center text-sm text-red-600">{error}</p>
          )}
        </div>

        <div className="mt-8 space-y-4">
          <button
            onClick={() => handleTypeSelect("nonprofit")}
            disabled={isLoading}
            className={`w-full flex items-center justify-center px-8 py-6 border-2 ${
              selectedType === "nonprofit"
                ? "border-teal-500"
                : "border-gray-300"
            } rounded-xl hover:border-gray-400 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-gray-500 disabled:opacity-50 disabled:cursor-not-allowed`}
          >
            <div className="text-left">
              <span className="text-2xl mb-2">üåç</span>
              <h3 className="text-lg font-medium text-gray-900">
                We're Nonprofits
              </h3>
              <p className="text-sm text-gray-500">
                NGOs, charities, and social organizations
              </p>
            </div>
            {isLoading && selectedType === "nonprofit" && (
              <div className="ml-3">
                <svg
                  className="animate-spin h-5 w-5 text-gray-500"
                  xmlns="http://www.w3.org/2000/svg"
                  fill="none"
                  viewBox="0 0 24 24"
                >
                  <circle
                    className="opacity-25"
                    cx="12"
                    cy="12"
                    r="10"
                    stroke="currentColor"
                    strokeWidth="4"
                  ></circle>
                  <path
                    className="opacity-75"
                    fill="currentColor"
                    d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"
                  ></path>
                </svg>
              </div>
            )}
          </button>

          <button
            onClick={() => handleTypeSelect("forprofit")}
            disabled={isLoading}
            className={`w-full flex items-center justify-center px-8 py-6 border-2 ${
              selectedType === "forprofit"
                ? "border-teal-500"
                : "border-gray-300"
            } rounded-xl hover:border-gray-400 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-gray-500 disabled:opacity-50 disabled:cursor-not-allowed`}
          >
            <div className="text-left">
              <span className="text-2xl mb-2">üíº</span>
              <h3 className="text-lg font-medium text-gray-900">
                We're For-Profits
              </h3>
              <p className="text-sm text-gray-500">
                Companies and businesses looking to make an impact
              </p>
            </div>
            {isLoading && selectedType === "forprofit" && (
              <div className="ml-3">
                <svg
                  className="animate-spin h-5 w-5 text-gray-500"
                  xmlns="http://www.w3.org/2000/svg"
                  fill="none"
                  viewBox="0 0 24 24"
                >
                  <circle
                    className="opacity-25"
                    cx="12"
                    cy="12"
                    r="10"
                    stroke="currentColor"
                    strokeWidth="4"
                  ></circle>
                  <path
                    className="opacity-75"
                    fill="currentColor"
                    d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"
                  ></path>
                </svg>
              </div>
            )}
          </button>
        </div>
      </div>
    </div>
  );
}
